                "HyperLinks": [
                    {
                        "Name": "Purr-loined Treasure Flask",
                        "Desc": "A small elemental vessel that Jahoda retrieves after casting her Elemental Skill <color style='color:#FFD780;'>Savvy Strategy: Splitting the Spoils</color>.<br>While Jahoda is in the Shadow Pursuit state, if nearby opponents are affected by <color style='color:#FF9999;'>Pyro</color>, <color style='color:#80C0FF;'>Hydro</color>, <color style='color:#FFACFF;'>Electro</color>, or <color style='color:#99FFFF;'>Cryo</color>, the Purr-loined Treasure Flask will convert to that element and begin filling up. The order of priority that determines which element will be converted to is: <color style='color:#FF9999;'>Pyro</color>, <color style='color:#80C0FF;'>Hydro</color>, <color style='color:#FFACFF;'>Electro</color>, then <color style='color:#99FFFF;'>Cryo</color>. After each use of her Elemental Skill, the Purr-loined Treasure Flask can undergo one such conversion.<br>When the Purr-loined Treasure Flask is full, Jahoda immediately drains it, exiting the Shadow Pursuit state and dealing a single instance of <color style='color:#80FFD7;'>Anemo DMG</color> to nearby opponents.<br>Each time the Elemental Skill is cast, Jahoda takes out a brand-new Purr-loined Treasure Flask.<br><br><color style='color:#FFD780;'>Moonsign: Ascendant Gleam</color>: When the <color style='color:#FFD780;'>Purr-loined Treasure Flask</color> becomes full, Jahoda will not immediately discharge it. Instead, for a short duration, she steadily consumes the stored element inside and periodically fires <color style='color:#FFD780;'>Fluffy Meowballs</color> at nearby opponents, dealing DMG of the corresponding element stored in the <color style='color:#FFD780;'>Purr-loined Treasure Flask</color>."
                    },
                    {
                        "Name": "Purrsonal Coordinated Assistance Robots",
                        "Desc": "One of the gadgets that Jahoda — a former treasure hunter — carries around with her. It is deployed upon using her Elemental Burst <color style='color:#FFD780;'>Hidden Aces: Seven Tools of the Hunter</color>.<br>Purrsonal Coordinated Assistance Robots continuously restore HP to your active character. If the healed character's HP is above 70%, they also restore HP to the nearby party member with the lowest HP.<br><br><color style='color:#FFD780;'>Moonsign: Ascendant Gleam</color>: If nearby opponents are affected by <color style='color:#FF9999;'>Pyro</color>, <color style='color:#80C0FF;'>Hydro</color>, <color style='color:#FFACFF;'>Electro</color>, or <color style='color:#99FFFF;'>Cryo</color>, Purrsonal Coordinated Assistance Robots will convert to that element. The order of priority that determines which element will be converted to is: <color style='color:#FF9999;'>Pyro</color>, <color style='color:#80C0FF;'>Hydro</color>, <color style='color:#FFACFF;'>Electro</color>, then <color style='color:#99FFFF;'>Cryo</color>. After each deployment, a Purrsonal Coordinated Assistance Robot can undergo one such conversion. After converting, the Purrsonal Coordinated Assistance Robot will periodically attack up to 3 nearby opponents, dealing damage of the corresponding element."
                    }
                ]
